import CloseIcon from "./Components/Icons/CloseIcon.vue";
import PinIcon from "./Components/Icons/PinIcon.vue";
import SerchIcon from "./Components/Icons/SerchIcon.vue";
import MapIcon from "./Components/Icons/MapItemIcon.vue";
import PassIcon from "./Components/Icons/PassItemIcon.vue";
import Header from "./Components/ContentHeader.vue";
import Main from "./Pages/Main.vue";
export default {
  data() {
    return {
      navList: [{
        title: "Игрок",
        path: "Player"
      }, {
        title: "Список игроков",
        path: "PlayersList"
      }, {
        title: "Телепорт",
        path: "TP"
      }, {
        title: "Транспорт",
        path: "TransportSpawn"
      }, {
        title: "Логи",
        path: "Logs"
      }, {
        title: "Консоль",
        path: "Console"
      }]
    };
  },
  computed: {
    isNotShowMain() {
      const listIsNoShow = ["player"];
      const path = this.$route.path.split("/")[2].toLowerCase();
      return listIsNoShow.includes(path);
    },
    selectedNav() {
      return this.$store.getters["adminPanel/getSelectedNav"];
    }
  },
  methods: {
    selectNav(path) {
      this.$store.dispatch("adminPanel/selectNav", path);
    },
    onkeyup(e) {
      if (e.keyCode === 27 && !window.isModalShow) {
        this.$callClient("C:AdminPanel:CloseApp");
      }
    }
  },
  components: {
    CloseIcon,
    PinIcon,
    SerchIcon,
    MapIcon,
    PassIcon,
    Header,
    Main
  },
  mounted() {
    window.addEventListener("keyup", this.onkeyup);
    this.$callClient("C:AdminPanel:Ready");
  },
  beforeUnmount() {
    window.removeEventListener("keyup", this.onkeyup);
  }
};
